@Knollie72 @NLwartracker No. Just no. Stop with repeating this nuclear threat. 
Every escalation by Russia made the support for Ukraine increase. If they use nuclear option Ukraine will get everything they ask for. 
And Russia's remaining "allies" won't like it either.

"US officials should not negotiate with Russian officials over the heads of Ukrainians. Washington has no right to do that." 

